INSERT INTO `blogs` VALUES (9,'Hà Nội – Ngàn năm văn hiến','Hà Nội gây ấn tượng với nét đẹp cổ kính, những con phố nhỏ, hồ Hoàn Kiếm thơ mộng, và nền ẩm thực phong phú như phở, bún chả, cốm làng Vòng. Nơi đây là trái tim của văn hóa và lịch sử Việt Nam với 36 phố phường nhộn nhịp. Hồ Tây, chùa Trấn Quốc, và Văn Miếu – Quốc Tử Giám mang đậm dấu ấn ngàn năm. Người Hà Nội thanh lịch, nhẹ nhàng, để lại ấn tượng khó quên trong lòng du khách. Mùa thu Hà Nội thơm hương hoa sữa, mùa xuân ngập tràn sắc đào Nhật Tân. Những quán cà phê nhỏ bên hè phố tạo nên nét rất riêng, rất Hà Nội. Ẩm thực nơi đây vừa tinh tế, vừa bình dị, khiến ai đi xa cũng nhớ về.','/Assets/vietnam.jpg','2025-06-08 03:52:00'),(10,'Seoul – Trái tim năng động','Seoul kết hợp giữa hiện đại và truyền thống, từ cung điện Gyeongbokgung đến phố sôi động như Myeongdong và Gangnam. Thành phố mang hơi thở của công nghệ nhưng vẫn giữ gìn văn hóa Hàn Quốc sâu sắc. Những ngôi chùa cổ, hanok truyền thống đan xen cùng các tòa nhà chọc trời. Cuộc sống về đêm ở Seoul rất nhộn nhịp, với các quán bar, chợ đêm và đường phố luôn rực sáng. Ẩm thực đường phố nổi tiếng với tteokbokki, gà rán Hàn Quốc và kimchi. Seoul còn là trung tâm của K-pop và thời trang châu Á. Nơi đây luôn tràn đầy năng lượng, hiện đại nhưng vẫn rất gần gũi.','/Assets/seoul.jpg','2025-06-08 03:52:00'),(11,'Paris – Thành phố của ánh sáng','Paris là biểu tượng của sự lãng mạn với tháp Eiffel, bảo tàng Louvre và dòng sông Seine thơ mộng. Thành phố này là nơi hội tụ của nghệ thuật, thời trang và lịch sử. Những con phố lát đá cổ kính, quán cà phê bên hè phố và các công trình kiến trúc tráng lệ khiến Paris trở nên quyến rũ. Ẩm thực Pháp tinh tế với bánh mì baguette, phô mai và rượu vang làm say lòng du khách. Paris về đêm lung linh ánh đèn, mang lại cảm giác vừa cổ điển, vừa hiện đại. Các buổi hòa nhạc và triển lãm nghệ thuật diễn ra quanh năm. Đây là điểm đến mơ ước của hàng triệu người trên thế giới.','/Assets/paris.jpg','2025-06-08 03:52:00'),(12,'Berlin – Thành phố lịch sử','Berlin nổi bật với lịch sử phong phú, từ bức tường Berlin đến các bảo tàng nghệ thuật đẳng cấp thế giới. Thành phố mang nét giao thoa giữa Đông và Tây, giữa cũ và mới. Berlin là nơi quy tụ các công trình kiến trúc hiện đại bên cạnh di tích lịch sử sâu sắc. Các khu phố như Kreuzberg hay Friedrichshain là trung tâm của văn hóa đường phố và sáng tạo. Cuộc sống tại Berlin phóng khoáng, cởi mở và đa dạng. Ẩm thực ở đây phong phú từ currywurst, pretzel đến các món ăn quốc tế. Berlin không chỉ là một điểm đến du lịch mà còn là trung tâm văn hóa sôi động của châu Âu.','/Assets/berlin.jpg','2025-06-08 03:52:00');
